import {useContext} from 'react'

import { CharacterContext } from '../../../shared/provider/StarWarsProvider'



export const AccessoriesView = () => {
    const [count, setCount] = useContext(CharacterContext)


    return (
        <div>
            <h1>SHOP</h1>

            <button onClick={() => console.log('Tst')}>Load Star Wars</button>
            <button onClick={() => setCount(count - 1)}>Previous</button>
            <button onClick={() => setCount(count + 1)}>Next</button>

        </div>
    )
}
